  return (
    <div>
      <ProgressBar bgcolor="#6a1b9a" completed={completed} />
      <button id="CalcOne" onClick={CalcOne}>Click Me</button>

      {/* Your page content */}
      {/* Include buttons for navigating to the next page and completing exercises */}
    </div>
  );
}

export default App;
